import { useAppTheme } from '../../../context/theme/ThemeAppContext';
import { Nav, NavLink } from './Navbar.styles';

export function Navbar() {
  const { toggleMode, mode } = useAppTheme();

  console.log(mode);

  return (
    <Nav>
      <ul>
        <li></li>
        <li>
          <NavLink to='/home'>Home</NavLink>
        </li>
      </ul>

      <input type='text' />

      <ul>
        <li>plus</li>
        <li>completed</li>
        <li>notifications</li>
        <li>user</li>
      </ul>
    </Nav>
  );
}
